import './App.css';

import img from "зг/../Rectangle 1 (1).png";

<div style={{ backgroundImage: `url(${img})` }}>example</div>



import React, { useState, useEffect } from "react";

function CountdownTimer() {
  const endDate = new Date("13-05-2023 12:00");
  const [timeLeft, setTimeLeft] = useState({});

  useEffect(() => {
    const timer = setInterval(() => {
      const difference = endDate - new Date();

      if (difference > 0) {
        setTimeLeft({
          days: Math.floor(difference / (1000 * 60 * 60 * 24)),
          hours: Math.floor((difference / (1000 * 60 * 60)) % 24),
          minutes: Math.floor((difference / 1000 / 60) % 60),
          seconds: Math.floor((difference / 1000) % 60),
        });
      } else {
        setTimeLeft({ days: 0, hours: 0, minutes: 0, seconds: 0 });
      }
    }, 1000);

    return () => clearInterval(timer);
  }, []);

  return (
    <div>
      {timeLeft.days !== undefined ? (
        <div className="countdown-timer">
          <div className="countdown-timer__item">
            <div className="countdown-timer__value">{timeLeft.days}</div>
            <div className="countdown-timer__label">дней</div>
          </div>
          <div className="countdown-timer__item">
            <div className="countdown-timer__value">{timeLeft.hours}</div>
            <div className="countdown-timer__label">часов</div>
          </div>
          <div className="countdown-timer__item">
            <div className="countdown-timer__value">{timeLeft.minutes}</div>
            <div className="countdown-timer__label">минут</div>
          </div>
          <div className="countdown-timer__item">
            <div className="countdown-timer__value">{timeLeft.seconds}</div>
            <div className="countdown-timer__label">секунд</div>
          </div>
        </div>
      ) : (
        <div className="countdown-timer">00 дней 00 часов 00 минут 00 секунд</div>
      )}
    </div>
  );
}

export default CountdownTimer;
